import './App.css';
import { useEffect } from 'react';

function App() {

  return (
    <div class='listContainer'>
      <ul>
        <li>스파게티</li>
        <li>파스타</li>
        <li>스테이크</li>
        <li>타코</li>
        <li>비빔밥</li>
      </ul>
    </div>
  )
}

export default App;
